import React, { useEffect, useState } from "react";


import './index.css';
/**
 * Query Cat API to get cats data when page loads
 * Use the search API to filter the cats by breed
 * 
 */


const BREEDS_BASE_URL = 'https://strangers-things.herokuapp.com/api/2111-CSU-RM-WEB-PT/posts';
const App = () => {
  const [entry, setEntry] = useState([]);

  useEffect(() => {
    const apiFetchData = async() => {
      const resp = await fetch(BREEDS_BASE_URL);
      console.log('getCats resp', resp);
      const entry = await resp.json();
      console.log('ENTRY', entry);
      apiFetchData(entry);
    };

    apiFetchData();
  }, [])

  return <>
    <h1>Stanger Things App!!</h1>

    {
      entry.map((entry, idx) => {
        return <div key={idx}>
          <h3>{entry.post}</h3>

        </div>
      })
    }

  </>
}



export default App;
